window.bookSummaryJSON = "<p>The shadows are in my blood.</p> <p>I can feel them crawling through me, slithering under my skin and taking me hostage.</p> <p>But the darkness within me, isn't nearly as bad as the darkness that lives around me.</p> <p>The four heirs will stop at nothing to destroy the lives of me and my sister.</p> <p>But they haven't figured out yet, we're the strongest creatures they've ever known...</p> <p>This is the fourth book in the Supernatural Bullies and Beasts series.</p> <p>Start the series now with Zodiac Academy: <i>The Awakening</i>.</p>"; 
